@import url("https://fonts.googleapis.com/css?family=Open+Sans");
header {
  height: 11%;
  width: 100%;
  position: fixed;
  top: 0;
  transition: 0.5s;
}
header nav {
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  list-style: none;
  color: white;
  font-family: "Open Sans", sans-serif;
  font-size: 15px;
  font-weight: bold;
}
header nav .active {
  color: #46a4d7;
}
header nav li {
  margin: 0px 15px;
}
header nav li a {
  text-decoration: none;
  color: white;
  transition: 0.4s;
}
header nav li a:hover {
  color: #46a4d7;
}
